{
  "openapi": "3.0.0",
  "servers": [
    {
      "url": "https://containers-api.ng.bluemix.net/v3"
    }
  ],
  "info": {
    "description": "Containers are virtual software objects that include all the elements that an app needs to run. A container has the benefits of resource isolation and allocation but is more portable and efficient than, for example, a virtual machine.\n\n This documentation describes the IBM Containers API, which is based on the Docker Remote API. The API provides endpoints that you can use to create and manage your single containers and container groups in Bluemix. Endpoints are summarized under the following tags: \n\n- **Authentication**: Retrieve and refresh your TLS certificates. \n- **Private Docker images registry**: Create your own private Docker images registry in Bluemix by setting a namespace for your organization. \n- **Images**: View, build, and push your images to your private Bluemix registry so you can use them with IBM Containers. You can also scan your container images with the Vulnerability Advisor against standard policies set by the organization manager and a database of known Ubuntu issues. \n- **Single Containers**: Create and manage single containers in Bluemix. Use a single container to implement short-lived processes or to run simple tests as you develop an app or service. To make your single container available from the internet, review the `Public IP addresses` endpoints. \n- **Container Groups**: Create and manage your container groups in Bluemix. A container group consists of multiple single containers that are all created from the same container image and as a consequence are configured in the same way. Container groups offer further options at no cost to make your app highly available. These options include in-built load balancing, auto-recovery of unhealthy container instances, and auto-scaling of container instances based on CPU and memory usage. Map a public route to your container group to make your app accessible from the internet.  \n- **Public IP addresses**: Use these endpoints to request public IP addresses for your space. You can bind this IP address to your container to make your container accessible from the internet. \n- **File shares**: Create, list and delete file shares in a space. A file share is a NFS storage system that hosts Docker volumes.  \n- **Volumes**: Create and manage container volumes in your space to persist the data of your containers.  \n\n\n Each API request requires an HTTP header that includes the \u0027X-Auth-Token’ and \u0027X-Auth-Project-Id’ parameter. \n\n- **X-Auth-Token**: The JSON web token (JWT) that you receive when logging into the Bluemix platform. It allows you to use the IBM Containers REST API, access services, and resources. Run `cf oauth-token` to retrieve your access token information.\n- **X-Auth-Project-Id**: The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.\n\n\n For further information about how containers work in the IBM Containers service, review the documentation under https://new-console.ng.bluemix.net/docs/containers/container_index.html. ",
    "license": {
      "name": "(C) Copyright IBM Corp. 2016 All Rights Reserved."
    },
    "title": "IBM Containers API",
    "version": "3.0.0",
    "x-apisguru-categories": [
      "developer_tools"
    ],
    "x-logo": {
      "url": "https://api.apis.guru/v2/cache/logo/https_twitter.com_IBMCloud_profile_image.jpeg"
    },
    "x-origin": [
      {
        "format": "openapi",
        "url": "http://ccsapi-doc.mybluemix.net/swagger.json",
        "version": "3.0"
      }
    ],
    "x-providerName": "bluemix.net",
    "x-serviceName": "containers"
  },
  "paths": {
    "/build": {
      "post": {
        "description": "This API builds a new container image from a Dockerfile that is stored on your local machine and pushes the image to the private Bluemix registry (corresponding IBM Containers command: `cf ic build`).\n\n To push an image to your Bluemix registry, a namespace must be set for the organization. Run `cf ic namespace get` or call the `GET /registry/namespaces` API to check if a namespace is already set. If not, run `cf ic namespace set NAMESPACE` or call the `PUT /registry/namespaces/{namespace}` API to set a namespace for your organization.",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Tag the image with the full path to your private Bluemix registry in the following format: `t\u003dregistry.ng.bluemix.net/\u003cnamespace\u003e/\u003cimage_name\u003e:\u003ctag\u003e`. This path is used to push the image to the private Bluemix registry after it is built.",
            "in": "query",
            "name": "t",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "You can choose whether or not to show the verbose build output to review every step during the container image build. If you set the query parameter to `q\u003dfalse`, `q\u003dFalse`, or `q\u003d0`, the verbose build output is suppressed. To show the verbose build output, enter `q\u003dtrue`, `q\u003dTrue`, or `q\u003d1`.",
            "in": "query",
            "name": "q",
            "required": false,
            "schema": {
              "type": "boolean"
            }
          },
          {
            "description": "If you set the query parameter to `nocache\u003dtrue`, `nocache\u003dTrue`, or `nocache\u003d1`, the cache will not be used to build your image. To use the cache, enter `nocache\u003dfalse`, `nocache\u003dFalse`, or `nocache\u003d0`.",
            "in": "query",
            "name": "nocache",
            "required": false,
            "schema": {
              "type": "boolean"
            }
          },
          {
            "description": "If set to pull\u003dtrue, pull\u003dTrue, or pull\u003d1, then a newer version of the image is always attempted to be pulled even though an older version of the image exists locally. If set to pull\u003dfalse, pull\u003dFalse, or pull\u003d0, then the local image will be used if one exists.",
            "in": "query",
            "name": "pull",
            "required": false,
            "schema": {
              "type": "boolean"
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/tar": {
              "schema": {
                "format": "binary",
                "type": "string"
              }
            }
          },
          "description": "Must be the content of a tar archive compressed with gzip. The archive must include a file called \u0027Dockerfile\u0027 at its root. It may include any number of other files which will be accessible in the build context.",
          "required": true
        },
        "responses": {
          "200": {
            "description": "OK. The container image was built successfully and pushed to your private Bluemix repository. The build output stream is returned in JSON format."
          },
          "400": {
            "description": "Bad request. Your could not be processed. Be sure to include the `t` query parameter to tag your image and that your Dockerfile has been tar archived with gzip."
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support."
          }
        },
        "summary": "Build a Docker image from a Dockerfile",
        "tags": [
          "Images"
        ]
      }
    },
    "/containers/create": {
      "post": {
        "description": "This endpoint creates and starts a single container in your space based on the Docker image that is specified in the Image field of the request json. A single container in IBM Containers is similar to a container that you create in your local Docker environment. Single containers are a good way to start with IBM Containers and to learn about how containers work in the IBM Cloud and the features that IBM Containers provides. They are also recommended when you want to run simple app tests or during the development process of an app. \n\n In the Docker API there are two separate APIs to create and start a container. However in IBM Containers a container is created and started in a single API call. Therefore, this API merges parameters from the Docker API to create and start container. \n\n To create a container with IBM Containers, you must at least define the image that the container is based on.\n\n- Image: You must include the full path to the image in your private Bluemix registry in the format: `registry.ng.bluemix.net/\u003cnamespace\u003e/\u003cimage\u003e`.",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Choose a name for your container. The characters in the name can include uppercase letters, lowercase letters, numbers, periods (.), underscores (_), or hyphens (-), but the name must start with a letter.",
            "in": "query",
            "name": "name",
            "required": false,
            "schema": {
              "type": "string"
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "properties": {
                  "BluemixApp": {
                    "description": "The name of the Cloud Foundry app that you want to bind to your container. The Cloud Foundry app must be created in the same space where you want to create your container.",
                    "type": "string",
                    "in": "REQUEST_BODY"
                  },
                  "Cmd": {
                    "description": "The command and arguments in this list are passed to the container to be executed when the container is started. This command must be a long-running command. Do not use a short-lived command, for example, /bin/date, because it might cause the container to crash. \u003cbr\u003eSample long-running commands:\u003cbr\u003e[\"ping\",\"localhost\"]\u003cbr\u003e[\"tail\",\"-f\",\"/dev/null\"]\u003cbr\u003e[\"sh\",\"-c\",\"while true; do date; sleep 20; done\"]\n",
                    "items": {
                      "type": "string",
                      "in": "REQUEST_BODY"
                    },
                    "type": "array",
                    "in": "REQUEST_BODY"
                  },
                  "Cpuset": {
                    "description": "Pins the container processes to a specific CPU core on the compute host. For example: 0 means that processes are executed on the first core only.",
                    "type": "string",
                    "in": "REQUEST_BODY"
                  },
                  "Env": {
                    "description": "A list of environment variables in the form of key\u003dvalue pairs. All keys in this list have to be unique. List multiple keys separately and if you include quotation marks, include them around both the environment variable name and the value.",
                    "items": {
                      "type": "string",
                      "in": "REQUEST_BODY"
                    },
                    "type": "array",
                    "in": "REQUEST_BODY"
                  },
                  "ExposedPorts": {
                    "description": "All public ports that need to be exposed for the container, so the container can be accessed from the Internet.",
                    "items": {
                      "type": "string",
                      "in": "REQUEST_BODY"
                    },
                    "type": "array",
                    "in": "REQUEST_BODY"
                  },
                  "HostConfig": {
                    "properties": {
                      "Binds": {
                        "description": "A list of volumes to be bound to the container. Each volume must be listed in the following format: VOLNAME:/CONTAINER_PATH:rw [ro]. ",
                        "items": {
                          "type": "string",
                          "in": "REQUEST_BODY"
                        },
                        "type": "array",
                        "in": "REQUEST_BODY"
                      },
                      "ExtraHosts": {
                        "description": "A list of hostnames/IP mappings to be added to the container’s /etc/hosts file. Specified in the form [\"hostname:IP\"]\n",
                        "items": {
                          "type": "string",
                          "in": "REQUEST_BODY"
                        },
                        "type": "array",
                        "in": "REQUEST_BODY"
                      },
                      "Links": {
                        "description": "A list of containers that need to be linked.",
                        "items": {
                          "type": "string",
                          "in": "REQUEST_BODY"
                        },
                        "type": "array",
                        "in": "REQUEST_BODY"
                      },
                      "PortBindings": {
                        "description": "The container ports that you want to expose to the public. Ports need to be specified in the form of \u0026lt;port\u0026gt;/\u0026lt;protocol\u0026gt;: [{ \"HostIp\": \"\u0026lt;IP\u0026gt;\", \"HostPort\": \"\u0026lt;port\u0026gt;\" }]\n",
                        "items": {
                          "type": "string",
                          "in": "REQUEST_BODY"
                        },
                        "type": "array",
                        "in": "REQUEST_BODY"
                      }
                    },
                    "type": "object",
                    "x-schemaName": "HostConfig",
                    "in": "REQUEST_BODY"
                  },
                  "Image": {
                    "description": "Full path to the image in your private Bluemix registry in the format `registry.ng.bluemix.net/namespace/image`. ",
                    "type": "string",
                    "required": true,
                    "in": "REQUEST_BODY"
                  },
                  "Memory": {
                    "description": "The container memory that is set for the container in Megabyte. Choose one of the following sizes: Pico 64 MB, Nano 128 MB, Micro 256 MB, Tiny 512 MB, Small 1 GB (1024 MB), Medium 2 GB (2048 MB), Large 4 GB (4096 MB) XLarge 8GB (8192 MB) and 2XLarge 16 GB (16384 MB).",
                    "format": "int32",
                    "type": "integer",
                    "in": "REQUEST_BODY"
                  },
                  "NumberCpus": {
                    "description": "Number of virtual CPUs that are allocated to the container.",
                    "format": "int32",
                    "type": "integer",
                    "in": "REQUEST_BODY"
                  },
                  "Volumes": {
                    "description": "Mount a volume to a container by specifying the details in the following format: `VOLUME_NAME:/DIRECTORY_PATH[:ro]`. Example: testvolume:/volumedata/temp:rw. By default, all volumes will be set up with read-write access inside the container (rw). If you wish to set up your volume with read-only access, enter `ro`.  Note: To mount a volume to a container, you must create the volume in your space first by using the `cf ic volume-create` command, or calling the `POST /volumes/create endpoint`.",
                    "type": "string",
                    "in": "REQUEST_BODY"
                  }
                },
                "x-schemaName": "CreateContainer",
                "type": "object",
                "in": "request_body"
              }
            }
          },
          "description": "Summary of input parameter to create a container in IBM Containers.",
          "required": true
        },
        "responses": {
          "201": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "Id": {
                      "description": "Unique ID representing a container.",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "flavor_id": {
                      "description": "The ID of the container size.",
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "mem": {
                      "description": "The amount of container memory that has been assigned to the container. If the container memory was not specified in the API request, a container with 64 Megabyte container memory is created by default.",
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "vcpu": {
                      "description": "Number of virtual CPUs that are assigned to the container.",
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    }
                  },
                  "x-schemaName": "ContainerId",
                  "type": "object",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "OK. The creation of a single container with the specified attributes has been initiated."
          },
          "400": {
            "description": "Bad request. The data that you entered in the request body are either incomplete or in the wrong format. Be sure to include at least the Docker image that you want to use in JSON format and re-run the API request."
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID."
          },
          "409": {
            "description": " Conflict. A container with the same name already exists. Choose another name for your container and re-run the API request."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support. "
          }
        },
        "summary": "Create and start a single container",
        "tags": [
          "Single containers"
        ]
      }
    },
    "/containers/floating-ips": {
      "get": {
        "description": "This endpoint returns a list of all public IP addresses that are allocated to a space and not bound to a container. If you want to list all public IP addresses that are allocated to a space, even those that are already bound to a container, use the `all` query parameter (corrsponding IBM Containers command: `cf ic ip list`).",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "If this option is set to `all\u003d1`, `all\u003dTrue`, or `all\u003dtrue`, all public IP addresses that are allocated to a space are returned. If this option is set to `all\u003d0`, `all\u003dFalse`, or `all\u003dfalse`, only available public IP addresses that are allocated but not bound to a container are returned. By default, only available public IP addresses are returned.",
            "in": "query",
            "name": "all",
            "required": false,
            "schema": {
              "type": "boolean"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "properties": {
                      "Bindings": {
                        "properties": {
                          "ContainerId": {
                            "description": "Unique identifier representing a container",
                            "type": "string",
                            "in": "RESPONSE_BODY"
                          }
                        },
                        "x-schemaName": "Binding",
                        "type": "object",
                        "in": "RESPONSE_BODY"
                      },
                      "IpAddress": {
                        "description": "The public IP address that is allocated to the organization space.",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      }
                    },
                    "x-schemaName": "FloatingIP",
                    "type": "object",
                    "in": "RESPONSE_BODY"
                  },
                  "type": "array",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "OK. A list of public IP addresses that are allocated to the space is returned."
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support."
          }
        },
        "summary": "List available public IP addresses in a space",
        "tags": [
          "Public IP addresses"
        ]
      }
    },
    "/containers/floating-ips/request": {
      "post": {
        "description": "This endpoint requests a new public IP address for a space (corresponding IBM Containers command: `cf ic ip request`). The number of public IP addresses depends on the quota that is assigned to the space. If there is not enough quota left to request a new public IP address, you can either contact your organization manager to increase the quota, or unbind an existing IP address from a container by running `cf ic ip unbind \u003cip_adress\u003e \u003ccontainer\u003e` command, or  calling the `POST /container/{name_or_id}/floating-ips/{ip}/unbind` endpoint.",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "description": "New public IP address that is allocated to your space.",
                  "type": "string",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "OK. A new public IP address is allocated to your space."
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID."
          },
          "402": {
            "description": "Payment required. This request exceeds the quota that is allocated to the space. You can either contact your organization manager to increase the quota, or unbind an existing IP address from a container by running `cf ic ip unbind \u003cip_adress\u003e \u003ccontainer\u003e`, or calling the `POST /container/{name_or_id}/floating-ips/{ip}/unbind` endpoint."
          },
          "409": {
            "description": "Conflict. This request exceeds the quota that is allocated to the space. You can either contact your organization manager to increase the quota, or unbind an existing IP address from a container by running `cf ic ip unbind \u003cip_adress\u003e \u003ccontainer\u003e`, or calling the `POST /container/{name_or_id}/floating-ips/{ip}/unbind` endpoint."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support."
          }
        },
        "summary": "Request a public IP address for a space",
        "tags": [
          "Public IP addresses"
        ]
      }
    },
    "/containers/floating-ips/{ip}/release": {
      "post": {
        "description": "This endpoint releases a public IP address from a space (corresponding IBM Containers command: `cf ic ip release \u003cip_adress\u003e`). The public IP address is no longer allocated to the space. If a container was bound to the IP address, it is automatically unbound.",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The public IP address that you want to release. Run `cf ic ip list` or call the `GET /containers/floating-ips?all\u003dtrue` endpoint to review all public IP address that are allocated to your space. After a public IP address is released, it will no longer be allocated to your space.",
            "in": "path",
            "name": "ip",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "204": {
            "description": "No Content. The public IP address has been released from your space."
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID."
          },
          "404": {
            "description": "Not found. The public IP address that you entered, could not be found. Run `cf ic ip list`, or call the `GET /containers/floating-ips?all\u003dtrue` endpoint to review your public IP addresses. Re-run the API call with the updated public IP address information."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support."
          }
        },
        "summary": "Release public IP address",
        "tags": [
