    "/volumes/create": {
      "post": {
        "description": "This endpoints creates a new volume in your space (corresponding IBM Containers command: `cf ic volume create VOLNAME`). A volume is used to persist and access app data between container restarts. Volumes are hosted on file shares that define the available actual storage in Bluemix and the number of input and output transactions per second (IOPS). \n\n After you have created a volume, you must mount it to a container by using the `--volume` option in the `cf ic run` (single containers) or `cf ic group create` (container groups) command. You can also define the volume as part of the HTTP body and send a request to the `POST /containers/create` (single containers) or `POST /containers/groups` (container groups) endpoints. \n\n Note: If you mount multiple containers in a space to the same volume, they share the data in the volume and can access them anytime. When a container is deleted, the associated volume is not removed.",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The name of the volume. The name must be unique for a space and can contain uppercase letters, lowercase letters, numbers, underscores (_), and hyphens (-).",
            "in": "query",
            "name": "name",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The name of the file share that the volume is hosted on. File shares can have different storage sizes and IOPS based on the required workload. If this field is left blank, the volume is hosted on the default file share.",
            "in": "query",
            "name": "fsName",
            "required": false,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "201": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "fsID": {
                      "description": " Unique identifier representing the file share on which the volume is hosted. ",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "hostPath": {
                      "description": "Full path to the mounted volume inside the container.",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "otherSpaceVisibility": {
                      "description": "List of space IDs in which the volume is visible and can be used by all the single containers and container groups. ",
                      "items": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "type": "array",
                      "in": "RESPONSE_BODY"
                    },
                    "spaceGuid": {
                      "description": "Unique identifier representing the space where the volume got created.",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "volName": {
                      "description": "The name of the volume.",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    }
                  },
                  "x-schemaName": "Volume",
                  "type": "object",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "Created. Your volume was successfully created in your space."
          },
          "400": {
            "description": "Bad request. Your request could not be processed due to missing parameter. Make sure to enter a name for your volume as part of your query and re-run the request"
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID."
          },
          "409": {
            "description": "Conflict. A volume with the same name already exists. Choose a new name for your volume and re-run the API call."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support. "
          }
        },
        "summary": "Create a volume in a space",
        "tags": [
          "Volumes"
        ]
      }
    },
    "/volumes/fs/create": {
      "post": {
        "description": "This endpoint creates a new file share in a space (corresponding IBM Containers command: `cf ic volume fs-create FSNAME FSSIZE FSIOPS`). \n\n A file share is a persistent NFS-based (Network File System) storage system that hosts Docker volumes in a Bluemix space and allows a user to store and access container and app-related files. To store files in a file share, you must create a container volume and save the data into this volume.\n\n As soon as you create your first volume in a space with the `cf ic volume create VOLNAME` command or the `POST /volumes/create` API endpoint, a default file share with 20 GB at 4 IOPS (Input Output operations Per Second) is created at no cost. \n\nThe organization manager can create file shares with specific storage size and IOPS to meet the storage needs of the space. File shares can be provisioned in sizes from 20 GB to 12 TB and at IOPS per GB of 0.25, 2 or 4. Run `cf ic volume fs-flavor-list` or call the `GET /volumes/fs/flavors/json` API endpoint to retrieve a list of available file share sizes. The file share size in relation to the number of IOPS impacts the speed that data can be read and written from and to the container volume.",
        "parameters": [
          {
            "description": "The Bluemix JSON web token that you receive when logging into Bluemix. Run `cf oauth-token` to retrieve your access token.",
            "in": "header",
            "name": "X-Auth-Token",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The unique ID of your organization space where you want to create or work with your containers. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID.",
            "in": "header",
            "name": "X-Auth-Project-Id",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "properties": {
                  "fsIOPS": {
                    "description": "The number of input/output transactions per second. Available values are 0.25, 2 or 4.",
                    "format": "double",
                    "type": "number",
                    "required": true,
                    "in": "REQUEST_BODY"
                  },
                  "fsName": {
                    "description": "The name of the new file share that you want to create. The name can contain uppercase letters, lowercase letters, numbers, underscores (_), and hyphens (-).",
                    "type": "string",
                    "required": true,
                    "in": "REQUEST_BODY"
                  },
                  "fsSize": {
                    "description": "The size of the file share in gigabyte. Run `cf ic volume fs-flavor-list` or call the GET /volumes/fs/flavors/json API endpoint to retrieve a list of available file share sizes. ",
                    "type": "integer",
                    "required": true,
                    "in": "REQUEST_BODY"
                  }
                },
                "type": "object",
                "x-schemaName": "FileshareParam",
                "in": "request_body"
              }
            }
          },
          "description": "The input parameter to create a new file share in a space.",
          "required": true
        },
        "responses": {
          "202": {
            "description": "Accepted. A new fileshare has been created. "
          },
          "400": {
            "description": "Bad request. The input parameter in the request body are either incomplete or in the wrong format. Be sure to include the file share name, size and number of IOPS as part of your request in JSON format."
          },
          "401": {
            "description": "Authentication failed. The Access Token is invalid, or the Space ID that you entered could not be found. Run `cf oauth-token` to retrieve your access token. Run `cf space \u003cspace_name\u003e --guid`, where `\u003cspace_name\u003e` is the name of your space, to retrieve your space ID. If your access token and space ID are correct, verify that you have been granted organization manager rights. Only organization managers can create file shares in a space."
          },
          "409": {
            "description": "Conflict. A file share with the same name already exists. Run `cf ic volume fs-list` or call the `GET /volumes/fs/json` API endpoint to get a list with all available file shares in this space. Choose a new name for your file share and re-run the API call."
          },
          "500": {
            "description": "Internal Server Error. The IBM Containers service is currently unavailable. Your request could not be processed. Please wait a few minutes and try again. If you still encounter this problem, note the incident ID and contact the IBM Bluemix support. "
          }
        },
        "summary": "Create a file share in a space",
        "tags": [
          "File shares"
        ]
      }
    },
